    static void process(Reader reader) {

        try {
            int numCases = reader.nextInt();

            for (int i = 1; i <= numCases; i++) {

                int cities = reader.nextInt();
                int dams = reader.nextInt();
                int[] distances = new int[cities];

                for (int j = 0; j < cities; j++) {
                    distances[j] = reader.nextInt();
                }

                result.append(i).append(": ");
                executeMethod(cities, dams, distances);
                if (i != numCases) {
                    result.append("\n");
                }
            }

            System.out.println(result.toString());

        } catch (Exception ex) {
            ex.printStackTrace();
        }
    }

    private static void executeMethod(int numOfCities, int dams, int[] distances) {
        int[] arr = new int[numOfCities];
        for (int i = 0; i < numOfCities; i++) {
            arr[i] = i;
        }
        ArrayList<int[]> permutations = combinationUtil(arr, new int[dams], 0, 0, dams);

        int[][] table = new int[permutations.size()][numOfCities];
        for (int i = 0; i < permutations.size(); i++) {
            int[] damCombination = permutations.get(i);
            int[] tableRow = table[i];

            for (int dam : damCombination) {
                tableRow[dam] = -1;
            }

            for (int city = 0; city < numOfCities; city++) {
                // TODO If damCombination array includes city
                if (tableRow[city] == -1) {
                    tableRow[city] = 0;
                    continue;
                }

                int distance = 99999999;
                for (int dam : damCombination) {
                    int distance1 = distances[city] - distances[dam];
                    distance1 = distance1 < 0 ? -distance1 : distance1;

                    if (distance > distance1)
                        distance = distance1;
                }

                tableRow[city] = distance;
            }
        }
        int lowestTotal = 9999999;
//        int[] totals = new int[permutations.size()];
        for (int i = 0; i < table.length; i++) {
            int[] ints = table[i];
            int total = 0;
            for (int anInt : ints) {
                total += anInt;
            }
            if (lowestTotal > total)
                lowestTotal = total;
//            totals[i] = total;
        }
        result.append(lowestTotal);

//        for (int[] ints : table) {
//            System.out.print("[");
//            for (int i = 0; i < ints.length; i++) {
//                int anInt = ints[i];
//                System.out.print((anInt == -1 ? "0" : anInt) + (i == ints.length - 1 ? "" : ", "));
//            }
//            System.out.println("]");
//        }
    }

    static ArrayList<int[]> combinationUtil(int[] arr, int[] data, int start, int index, int r) {
        // Current combination is ready to be printed, print it
        int end = arr.length - 1;

        ArrayList<int[]> permutations = new ArrayList<>();
        // Current combination is ready to be printed, print it
        if (index == r) {
            int[] ints = new int[r];
            System.arraycopy(data, 0, ints, 0, r);
            permutations.add(ints);
            return permutations;
        }

        // replace index with all possible elements. The condition
        // "end-i+1 >= r-index" makes sure that including one element
        // at index will make a combination with remaining elements
        // at remaining positions
        for (int i = start; i <= end && end - i + 1 >= r - index; i++) {
            data[index] = arr[i];
            permutations.addAll(combinationUtil(arr, data, i + 1, index + 1, r));
        }
        return permutations;
    }
